import TextField from '@mui/material/TextField';

function App() {
  return (
    <center id="App">
      <h1 className="blue">HAVE YOU SEEN THIS PERSON???</h1>
      <p>
        Greetings!<br/>
        This is a silly little webpage that I made to collect data for another project. 
        I need a large database of named images and so I felt it would be fun to outsouce 
        that using  <a className="blue" href="https://this-person-does-not-exist.com/en">this-person-doesnt-exist.com</a> api to collect that data.
        If you wouldn't mind filling out the form bellow a few times that would make my day :)
      </p>Visit W3Schools.com!
      <div>
        <img src="https://www.w3schools.com/html/html5_intro.gif" alt="HTML5" width="100" height="100"/>
        <form>
          <TextField id="standard-basic" label="Standard" variant="filled" color="success" focused />
        </form>
      </div>
    </center>
  );
}

export default App;
